import React, { Component } from 'react';

class Photos extends Component {
  render() {
    return photos.map((photo, index) => (
      <img src={photo.src} alt={photo.alt} key={index} />
    ));
  }
}

const photos = [
  {
    src: './curry.jpg',
    width: 1,
    height: 1,
    alt: '',
  },
